    frame: {
        width: '213px',
        height: '94px',
        backgroundColor: '#FFFFFF',
        border: 'solid 0.5px #AAAAAA',
        borderRadius: '5px',
        margin: 'auto'        

    },
    texttitle: {
        fontSize: '22.6px',
        fontWeight: 'bold',
        color: '#4A4A4A'
    },
    subTitle: {
        fontSize: '19.4px',
        color: '#4A4A4A'

    },
    namebed: {
        fontSize: '16px',
        color: '#4A4A4A'
    },
    feedetail: {
        fontSize: '13px',
        color: '#4A4A4A'
    }

}));

export default function FeeCard() {
    const classes = useStyles()
    return (
        <div className={classes.frame}>
            <div>
                <div className={classes.texttitle}>
                    Set A
                </div>
                <div>
                    {/* icon */}
                </div>
            </div>
            <div className={classes.feedetail}>
                Room Price • Electricity • Water
                • Car Parking, …
            </div>

        </div>
    )
}
